import React, { createContext } from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

// для прокидывания состояний
const Context = createContext(null);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <Context.Provider>
    <App />
  </Context.Provider>
);

